@Override
public int hashCode() {
  final int prime = 31;
  int result = 0;
  final int end = offset + length;
  for(int i = offset; i < end; i++) {
    long value = ints[i];
    result = prime * result + (int) (value ^ (value >>> 32));
  }
  return result;
}

